import ChatBot from 'react-simple-chatbot';
import { ThemeProvider } from 'styled-components';
import { useState, useEffect } from 'react';

const classicalTheme = {
  background: '#f5f8fb',
  fontFamily: 'Helvetica',
  headerBgColor: '#ef4444',
  headerFontColor: '#fff',
  headerFontSize: '15px',
  botBubbleColor: '#ef4444',
  botFontColor: '#fff',
  userBubbleColor: '#fff',
  userFontColor: '#4a4a4a',
};

const initChatLog = (pokemonName) => {
  let chatLog = [] 

  chatLog.push({
      id: 1,
      message: `Looking for ${pokemonName} in the database...`,
      trigger: 2,
      placeholder: 'Please be patient',
    })
  chatLog.push({
      id: 2,
      message: `TRY FIRST`,
      trigger: 3,
      placeholder: 'Please be patient',
    })
  chatLog.push({
      id: 3,
      message: `That is not ${pokemonName}, FAIL #1`,
      trigger: 4,
      placeholder: 'Please be patient',
    })

  for ( let i = 4; i < 7300; i++) {
    if (i % 2 === 0) {
      chatLog.push({
        id: i,
        message: `TRY NEXT`,
        trigger: i + 1,
        placeholder: 'Please be patient',
      })
    } else {
      if (i % 13 === 0) {
        chatLog.push({
          id: i,
          message: `Trying my best to find ${pokemonName}, FAIL #${Math.floor(i / 2)}`,
          trigger: i + 1,
          placeholder: 'Please be patient',
        })
      } else if (i % 19 === 0) {
        chatLog.push({
          id: i,
          message: `Leaving no stone unturned for ${pokemonName}, FAIL #${Math.floor(i / 2)}`,
          trigger: i + 1,
          placeholder: 'Please be patient',
        })
      } else if (i % 39 === 0) {
        chatLog.push({
          id: i,
          message: `Putting out all the stops for ${pokemonName}, FAIL #${Math.floor(i / 2)}`,
          trigger: i + 1,
          placeholder: 'Please be patient',
        })
      } else if (i % 67 === 0) {
        chatLog.push({
          id: i,
          message: `Stopping at nothing but ${pokemonName}, FAIL #${Math.floor(i / 2)}`,
          trigger: i + 1,
          placeholder: 'Please be patient',
        })
      } else if (i % 31 === 0) {
      chatLog.push({
        id: i,
        message: `Putting my soul into finding ${pokemonName}, FAIL #${Math.floor(i / 2)}`,
        trigger: i + 1,
        placeholder: 'Please be patient',
      })
      } else {
        chatLog.push({
          id: i,
          message: `That is not ${pokemonName}, FAIL #${Math.floor(i / 2)}`,
          trigger: i + 1,
          placeholder: 'Please be patient',
        })
      }
    }
  }

  chatLog.push({
    id: 7300,
    message: `FOUND ${pokemonName} after 3600 tries in 1 hour`,
    end: true,
    placeholder: '',
  })

  return chatLog
}

const Algorithm = ({algorithmName, pokemonName}) => {
  const chatLog = initChatLog(pokemonName)
  const chatLogSlice00 = [...chatLog].slice(0 * 200, 200)
  const chatLogSlice01 = [...chatLog].slice(0 * 200, 200)
  const chatLogSlice02 = [...chatLog].slice(0 * 200, 200)
  const chatLogSlice03 = [...chatLog].slice(0 * 200, 200)
  const chatLogSlice04 = [...chatLog].slice(0 * 200, 200)
  const chatLogSlice05 = [...chatLog].slice(0 * 200, 200)
  const chatLogSlice06 = [...chatLog].slice(0 * 200, 200)
  const chatLogSlice07 = [...chatLog].slice(0 * 200, 200)
  const chatLogSlice08 = [...chatLog].slice(0 * 200, 200)
  const chatLogSlice09 = [...chatLog].slice(0 * 200, 200)
  const chatLogSlice10 = [...chatLog].slice(0 * 200, 200)
  const chatLogSlice11 = [...chatLog].slice(0 * 200, 200)
  const chatLogSlice12 = [...chatLog].slice(0 * 200, 200)
  const chatLogSlice13 = [...chatLog].slice(0 * 200, 200)
  const chatLogSlice14 = [...chatLog].slice(0 * 200, 200)
  const chatLogSlice15 = [...chatLog].slice(0 * 200, 200)
  const chatLogSlice16 = [...chatLog].slice(0 * 200, 200)
  const chatLogSlice17 = [...chatLog].slice(0 * 200, 200)
  const chatLogSlice18 = [...chatLog].slice(0 * 200, 200)  

  const [time, setTime] = useState(Date.now());
  const [displayedLog, setDisplayedLog] = useState(chatLogSlice00)

  useEffect(() => {

    const interval = setInterval(() => setTime(Date.now()), 1000 * 1 * 60);
    return () => {
      clearInterval(interval);
      setDisplayedLog(chatLogSlice04)
    };
  }, []);

  return (
    <ThemeProvider theme={classicalTheme}>
      <ChatBot
        key={time}
        hideBotAvatar={true}
        botDelay={500}
        headerTitle={algorithmName}
        steps={displayedLog}
      />
    </ThemeProvider>
  )
}

export default Algorithm
